      subroutine bemsav(x,p)
        implicit none
        real*8,dimension(1:55),intent(in)::x
        real*8,dimension(1:5809),intent(out)::p
        ! ::::::::::::::::::::
        real*8,dimension(1:16422)::m

        call evmono(x,m)
        call evpoly(m,p)

        return
      end subroutine bemsav
    
      subroutine emsav(x,c,energy)
        implicit none
        real*8, intent(in) :: x(55), c(5809)
        real*8, intent(inout) :: energy
        real*8 :: p(5809)
        integer :: i
       
        call bemsav(x,p)

        energy=0.d0
   
        do i=1,5809
          energy=energy+c(i)*p(i)
        enddo

      end subroutine emsav

    end module bemsa

      subroutine pes(x,igrad,path,p,gradient_out,d)

      implicit none
      ! number of electronic state
      integer, parameter :: nstates=1
      integer, parameter :: natoms=11
      integer, intent(in) :: igrad
      character(len=1024), intent(in) :: path
      double precision, intent(in) :: x(natoms,3)
      double precision, intent(out) :: p(nstates)
      double precision, intent(out) :: gradient_out(nstates,natoms,3)
      double precision, intent(out) :: d(nstates,nstates,natoms,3)

      real*8 :: v
      integer :: iatom, idir, j, istate
      logical, save :: first_time_data=.true.
      !initialize 
      gradient_out=0.d0
      d=0.d0

      if (igrad==0) then
        if(first_time_data) then
          call prepot(path)
          first_time_data=.false.
        endif
        call pot(x, v)
        v=v*27.211386
        do istate=1,nstates
          p(istate)=v
        enddo
      else
        write (*,*) 'Only energy is available'
      endif


      endsubroutine

    subroutine prepot(path)
    use bemsa
    implicit none
    character(len=1024), intent(in) :: path
    character(len=1024) :: file_path1
    integer :: i, ncoeff, numero
    
    ! Geometry coordinates must be provided as a matrix xyz (11,3)
    
    file_path1=trim(path)//"/CH4_H2O_H2O/coeff_CH4-H2O-H2O.dat"
